import React from 'react';

const Header = () => {
  return (
    <div className="header-container">
      <div className="header">
        <img src="/imagenes/logo.jpg.png" alt="" className="img" />
        <h1 className="title">Formulario de Reserva</h1>
      </div>
    </div>
  );
};

export default Header;
